import { useQuery } from "@tanstack/react-query";
import {IPaginatorResponse} from "@shared/api";
import {ISpace, SpaceService} from "@entities/space";

export class SpaceRepository {
    static keys = {
        root: ["space"],

        me: {
            root: () => [...SpaceRepository.keys.root, "me"],
        }
    }

    static getMy = () => useQuery<
        IPaginatorResponse<ISpace>,
        Error
    >({
        queryKey: SpaceRepository.keys.me.root(),

        queryFn: async () => {
            console.log("get");
            const response = await SpaceService.getMy();

            await new Promise(resolve => setTimeout(resolve, 500));

            return response;
        },

        retry: 3
    });
}
